import React from "react";
import { BrowserRouter } from "react-router-dom";
import App from "./App";
import "./fonts/Font.css";

const root = ReactDOM.createRoot(document.getElementById("root"));

root.render(
  <>
    <BrowserRouter>
      <App />
    </BrowserRouter>
    ,
  </>
);
